import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";

import API1 from "./API1";
import RandomUser2 from "./RandomUser2";

const App = () => {
  const Stack = createNativeStackNavigator();

  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen 
          name="API1"
          component={API1} 
          options={{
            headerShown: false
          }}
        />
         <Stack.Screen 
          name="RandomUser2"
          component={RandomUser2} 
          options={{
            headerShown: false
          }}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
